import React, { useEffect } from 'react';
import { useStarWarsContext } from '../Context/StarWarsContext';

const TablePlanets = () => {
  const { data, fetchPlanetsStarWars } = useStarWarsContext();

  useEffect(() => {
    fetchPlanetsStarWars();
  }, []);

  return (
    <table>
      <tr>
        <th>Name</th>
      </tr>
      {data.map((
        { name,
          rotation_period,
          orbital_period,
          diameter,
          climate,
          gravity,
          terrain,
          surface_water,
          population,
          films,
          created,
          edited,
          url,
        },
      ) => (name)) }
    </table>
  );
};

export default TablePlanets;
